import React, { useState, useEffect } from 'react';
import { ListItem, Typography, Box, Divider, List } from "@mui/material";
import api from "../../api";
import ClearIcon from '@mui/icons-material/Clear';
export default function Notify() {
    const [notifyData, setNotifyData] = useState([]);
    const [notifyLength, setNotifyLength] = useState(0);
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await api.get('/get/requests');
                setNotifyData(response.data.success);
                setNotifyLength(notifyData.length);
                localStorage.setItem('notify_count', notifyLength);
                console.log(notifyLength)
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        };
        fetchData();
    }, []);


    const handleDeleteNotify = () => {

    };

    return (
        <List>
            {notifyData.map((item) => (
                <ListItem key={item.id}>

                    <Typography>Request sent at:{item.created_at} Status:{item.status}

                    </Typography>
                    <Divider></Divider>
                    <ClearIcon

                        sx={{ position: 'absolute', top: 5, right: 5, cursor: 'pointer' }}
                        onClick={() => handleDeleteNotify(item.id)}
                    />


                </ListItem>
            ))}
        </List>
    )
}
